window.bookSummaryJSON = "<p><b>Action and Adventure in the Florida Keys</b> </p> <p><i>From the number-one best-selling author of </i>Wood's Reef<i> and </i>Bonefish Blues<i> </i></p> <p><i>Mac Travis is forced to save his name and everything he owns after a down-on-her-luck trust-fund heiress talks his deckhand into using his boat to poach lobster. The plot thickens when Mac and his girlfriend, Mel, discover a connection between her nonprofit's money laundering scheme and a CIA ring smuggling baseball players from Cuba. </i></p> <p><i>Fans of Clive Cussler's Dirk Pitt and John MacDonald's Travis McGee, meet Mac Travis. </i></p> <p><i>Action and adventure fiction interlaced with conspiracy and political intrigue set in the Florida Keys, featuring fishing, scuba diving, and boating. Immerse yourself and enjoy the weather, Keys counterculture, and exotic locales. </i></p>"; 
